import React, { useEffect, useState } from "react";
import InteractionPercentage from '../component/interaction-percentage/InteractionPercentage';
import InteractionTable from '../component/interaction-table/InteractionTable';
import NavBar from '../component/navbar/NavBar';
import axios from 'axios';
import CircularProgress from '@mui/material/CircularProgress';
import Box from '@mui/material/Box';


const Home = () => {
  const [data, setData] = useState([]);
  const [showLoading, setShowLoading] = useState(false);

  useEffect(() => {
    setShowLoading(true)
    axios.get(`http://localhost:8080/interactions`)
    .then(res => {
      const interactions = res.data;
      setData(interactions);
      setShowLoading(false)
    })
  }, [])

  return (
    <div style={{height:"auto", backgroundColor:"rgba(0,0,0,0.8)"}}>
        <NavBar />  
        <div style={{padding:"40px", backgroundColor:"rgba(0,0,0,0.6)", margin:"30px", height:"100vh"}}>
          {showLoading && (
        <Box sx={{ display: 'flex' }}>
          <CircularProgress />
        </Box>)}
        {data.length > 0 &&
            <div>
              <InteractionPercentage data={data}/>
              <InteractionTable data={data}/>
            </div>
            }
        </div>
    </div>
  )
}

export default Home;
